/**
 * Copyright - DocsApp
 */

import React from 'react';

import Navigation from './Navigation';
import Home from './Home';
import About from './About';


export default class Index extends React.Component {

  constructor(props) {
    super();
    this.state = {
      showUploadPopup: false,
      uploadCalledForLeadId: null
    }
  }


  render() {
    return (
      <div>
        <Navigation />
        <Home />
        <About />
      </div>
    );
  }

}
